const Footer=()=>{
return(
    <footer className="footer">
        <div className="footer-social-media">
            <div className="footer-social-media-text">Follow us on social media</div>
            <div className="footer-social-media-icons">
                
            </div>
        </div>
    </footer>
);
}

export default Footer;
